  const buttonClicked = () =>{
    console.log("button of " + title + " has been clicked");
  }
  return (
    <Card className="expense-item">
      <ExpDate d = {date}/>
      <div className="expense-item__description">
        <h2>{title}</h2>
        <div className="expense-item__price">$ {amount}</div>
      </div>
      <button onClick={buttonCl} >Change Title</button>
    </Card>
  );
};

